import React from 'react';

class Message extends React.Component{
    constructor() {
        super();
        this.state = {
            errorMessage: '',
            page: ''
        }

        this.changePage = this.changePage.bind(this);

    }

    changePage =  (page) => {
        this.setState({
            page: page
        })
    }

    render() {

        const page =
            <div className="row">
                <div className="col-4 border-left" style={{height: "88.5vh"}}>

                    <div className="row mt-1 justify-content-center">
                            <div className="col-12">
                                <div className="row pt-2 pb-2 navbar-element navbar-profile">
                                    <div className="col-2 text-center">
                                        <span className="" style={{fontSize: '170%'}}>
                                            <img className="small-image-50 rounded-circle border border-dark"
                                                 src="../static/images/profile_pictures/eudo.png" alt="Eudoxie"/>
                                        </span>
                                    </div>
                                    <div className="col-10 pl-4 text-navbar">
                                        <div className="row">
                                            <div className="col-9 border">
                                                <h5 className="">
                                                    Eudoxie
                                                </h5>
                                                <span style={{ opacity : '0.6' }}>
                                                    bla bla
                                                </span>
                                            </div>
                                            <div className="col-3">
                                                45 min
                                            </div>
                                        </div>

                                    </div>
                                </div>
                            </div>
                    </div>

                </div>

                <div className='col-8 border-left'>
                </div>
            </div>

        return (page);
    }
}

export default Message;
